  [],\n\t\"revision_timestamp\": \"2016-10-29T19:05:39.374752\",\n\t\"name\": \"verification-account-management-system-vams\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Verification Account Management System
  (VAMS) is the centralized location for maintaining SSA's verification and data exchange
  accounts. VAMS account management functionalities include: creating new accounts,
  selecting account parameters, searching for existing accounts, updating current
  accounts and generating MI reports. All accounts in VAMS are issued a unique Verification
  Account Number (VAN). This VAN is used to determine account status prior to processing
  the verification or data exchange request. Currently all requests from Enumeration
  Verification Systems (EVS), Numident Online Verification Utility (NOVU), State Verification
  Exchange System (SVES), and State Online Query System (SOLQ) are verified in VAMS.
  In addition, VAMS interfaces with the Data Exchanges and Verifications Online (DEVO)
  application as it stores the account parameters used for parameter driven processing.\",\n\t\"license_title\":
